import React from "react";
import {FaTimes, FaPen, FaRegCircle} from "react-icons/fa";


const Icon = ({name}) =>{
return(
    <div>
        <h1><FaTimes className="icons" /></h1>

        <h2><FaPen className="icons" /></h2>
        <h3><FaRegCircle className="icons"/>></h3>
    </div>


    );
}
export default Icon;
